import "./App.css";
import { Home } from "./components/Home";
import { Department } from "./components/Departments";
import { Employee } from "./components/Employee";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <>
      <BrowserRouter>
      <h3 className="m-3 d-flex justify-content-center">React js bootstrsp</h3>
      <h5 className="m-3 d-flex justify-content-center">Employee management portal</h5>
        <Routes>
          <Route path='/' element={<Home/>} exact />
          <Route path='/department' element={<Department/>} exact />
          <Route path='/employee' element={<Employee/>} exact />
        </Routes> 
      </BrowserRouter>
    </>
  );
}

export default App;
